The only entries that add to paid‐in capital are the “Initial” entries. In this trial there are three “Initial20231231001” entries – one for a cash deposit of 3,000,000, one for a bank deposit of 5,000,000 and one for fixed assets of 5,000,000, which together total 13,000,000. No later transaction is “capital-raising” or “capital contribution” so the paid‐in capital remains unchanged.

Thus, the Paid‐in Capital initial value is 13,000,000.00 and the final (end) value is also 13,000,000.00.

